An extern "Rust" function returning a Result turns into a throw in C++ if the Rust side produces an error. Note that the return type written inside of cxx::bridge must be written without a second type parameter. Only the Ok type is specified for the purpose of the FFI. The Rust implementation (outside of the bridge module) may pick any error type as long as it has a std::fmt::Display impl. # use std::io;
#
#[cxx::bridge]
mod ffi { extern "Rust" { fn fallible1(depth: usize) -> Result<String>; fn fallible2() -> Result<()>; }
} fn fallible1(depth: usize) -> anyhow::Result<String> { if depth == 0 { return Err(anyhow::Error::msg("fallible1 requires depth > 0")); } ...
} fn fallible2() -> Result<(), io::Error> { ... Ok(())
} The exception that gets thrown by CXX on the C++ side is always of type rust::Error and has the following C++ public API. The what() member function gives the error message according to the Rust error's std::fmt::Display impl. // rust/cxx.h
...
...namespace rust { class Error final : public std::exception {
public: Error(const Error &); Error(Error &&) noexcept; ~Error() noexcept; Error &operator=(const Error &) &; Error &operator=(Error &&) & noexcept; const char *what() const noexcept override;
};
...
...} // namespace rust

