An extern "C++" function returning a Result turns into a catch in C++ that converts the exception into an Err for Rust. Note that the return type written inside of cxx::bridge must be written without a second type parameter. Only the Ok type is specified for the purpose of the FFI. The resulting error type created by CXX when an extern "C++" function throws will always be of type cxx::Exception . # use std::process;
#
#[cxx::bridge]
mod ffi { unsafe extern "C++" { include!("example/include/example.h"); fn fallible1(depth: usize) -> Result<String>; fn fallible2() -> Result<()>; }
} fn main() { if let Err(err) = ffi::fallible1(99) { eprintln!("Error: {}", err); process::exit(1); }
} The specific set of caught exceptions and the conversion to error message are both customizable. The way you do this is by defining a template function rust::behavior::trycatch with a suitable signature inside any one of the headers include!'d by your cxx::bridge. The template signature is required to be: namespace rust {
namespace behavior { template <typename Try, typename Fail>
static void trycatch(Try &&func, Fail &&fail) noexcept; } // namespace behavior
} // namespace rust The default trycatch used by CXX if you have not provided your own is the following. You must follow the same pattern: invoke func with no arguments, catch whatever exception(s) you want, and invoke fail with the error message you'd like for the Rust error to have. ...#include <exception>
...
...namespace rust {
...namespace behavior {
...
template <typename Try, typename Fail>
static void trycatch(Try &&func, Fail &&fail) noexcept try { func();
} catch (const std::exception &e) { fail(e.what());
}
...
...} // namespace behavior
...} // namespace rust

