So far the calls in both directions above only used opaque types , not shared structs . Shared structs are data structures whose complete definition is visible to both languages, making it possible to pass them by value across the language boundary. Shared structs translate to a C++ aggregate-initialization compatible struct exactly matching the layout of the Rust one. As the last step of this demo, we'll use a shared struct BlobMetadata to pass metadata about blobs between our Rust application and C++ blobstore client. // src/main.rs #[cxx::bridge]
mod ffi { struct BlobMetadata { size: usize, tags: Vec<String>, } extern "Rust" { // ...
# type MultiBuf;
#
# fn next_chunk(buf: &mut MultiBuf) -> &[u8]; } unsafe extern "C++" { // ...
# include!("cxx-demo/include/blobstore.h");
#
# type BlobstoreClient;
#
# fn new_blobstore_client() -> UniquePtr<BlobstoreClient>;
# fn put(&self, parts: &mut MultiBuf) -> u64; fn tag(&self, blobid: u64, tag: &str); fn metadata(&self, blobid: u64) -> BlobMetadata; }
}
#
# pub struct MultiBuf {
# chunks: Vec<Vec<u8>>,
# pos: usize,
# }
# pub fn next_chunk(buf: &mut MultiBuf) -> &[u8] {
# let next = buf.chunks.get(buf.pos);
# buf.pos += 1;
# next.map_or(&[], Vec::as_slice)
# } fn main() { let client = ffi::new_blobstore_client(); // Upload a blob. let chunks = vec![b"fearless".to_vec(), b"concurrency".to_vec()]; let mut buf = MultiBuf { chunks, pos: 0 }; let blobid = client.put(&mut buf); println!("blobid = {blobid}"); // Add a tag. client.tag(blobid, "rust"); // Read back the tags. let metadata = client.metadata(blobid); println!("tags = {:?}", metadata.tags);
} // include/blobstore.h #pragma once
#include "rust/cxx.h"
...#include <memory> struct MultiBuf;
struct BlobMetadata; class BlobstoreClient {
public: BlobstoreClient(); uint64_t put(MultiBuf &buf) const; void tag(uint64_t blobid, rust::Str tag) const; BlobMetadata metadata(uint64_t blobid) const; private: class impl; std::shared_ptr<impl> impl;
};
...
...std::unique_ptr<BlobstoreClient> new_blobstore_client(); // src/blobstore.cc #include "cxx-demo/include/blobstore.h"
#include "cxx-demo/src/main.rs.h"
#include <algorithm>
#include <functional>
#include <set>
#include <string>
#include <unordered_map> // Toy implementation of an in-memory blobstore.
//
// In reality the implementation of BlobstoreClient could be a large
// complex C++ library.
class BlobstoreClient::impl { friend BlobstoreClient; using Blob = struct { std::string data; std::set<std::string> tags; }; std::unordered_map<uint64_t, Blob> blobs;
}; BlobstoreClient::BlobstoreClient() : impl(new class BlobstoreClient::impl) {}
...
...// Upload a new blob and return a blobid that serves as a handle to the blob.
...uint64_t BlobstoreClient::put(MultiBuf &buf) const {
... // Traverse the caller's chunk iterator.
... std::string contents;
... while (true) {
... auto chunk = next_chunk(buf);
... if (chunk.size() == 0) {
... break;
... }
... contents.append(reinterpret_cast<const char *>(chunk.data()), chunk.size());
... }
...
... // Insert into map and provide caller the handle.
... auto blobid = std::hash<std::string>{}(contents);
... impl->blobs[blobid] = {std::move(contents), {}};
... return blobid;
...} // Add tag to an existing blob.
void BlobstoreClient::tag(uint64_t blobid, rust::Str tag) const { impl->blobs[blobid].tags.emplace(tag);
} // Retrieve metadata about a blob.
BlobMetadata BlobstoreClient::metadata(uint64_t blobid) const { BlobMetadata metadata{}; auto blob = impl->blobs.find(blobid); if (blob != impl->blobs.end()) { metadata.size = blob->second.data.size(); std::for_each(blob->second.tags.cbegin(), blob->second.tags.cend(), [&](auto &t) { metadata.tags.emplace_back(t); }); } return metadata;
}
...
...std::unique_ptr<BlobstoreClient> new_blobstore_client() {
... return std::make_unique<BlobstoreClient>();
...} cxx-demo$ cargo run Running `target/debug/cxx-demo` blobid = 9851996977040795552
tags = ["rust"] You've now seen all the code involved in the tutorial. It's available all together in runnable form in the demo directory of https://github.com/dtolnay/cxx . You can run it directly without stepping through the steps above by running cargo run from that directory.

