#[cxx::bridge]
mod ffi { extern "Rust" { }
} The extern "Rust" section of a CXX bridge declares Rust types and signatures to be made available to C++. The CXX code generator uses your extern "Rust" section(s) to produce a C++ header file containing the corresponding C++ declarations. The generated header has the same path as the Rust source file containing the bridge, except with a .rs.h file extension. A bridge module may contain zero or more extern "Rust" blocks.

