Types defined in Rust that are made available to C++, but only behind an indirection. # #[cxx::bridge]
# mod ffi { extern "Rust" { type MyType; type MyOtherType; type OneMoreType<'a>; }
# } For example in the Tutorial we saw MultiBuf used in this way. Rust code created the MultiBuf, passed a &mut MultiBuf to C++, and C++ later passed a &mut MultiBuf back across the bridge to Rust. Another example is the one on the Box<T> page, which exposes the Rust standard library's std::fs::File to C++ as an opaque type in a similar way but with Box as the indirection rather than &mut. The types named as opaque types (MyType etc) refer to types in the super module, the parent module of the CXX bridge. You can think of an opaque type T as being like a re-export use super::T made available to C++ via the generated header. Opaque types are currently required to be Sized and Unpin . In particular, a trait object dyn MyTrait or slice [T] may not be used for an opaque Rust type. These restrictions may be lifted in the future. For now, types used as extern Rust types are required to be defined by the same crate that contains the bridge using them. This restriction may be lifted in the future. The bridge's parent module will contain the appropriate imports or definitions for these types. use path::to::MyType; pub struct MyOtherType { ...
}
#
# #[cxx::bridge]
# mod ffi {
# extern "Rust" {
# type MyType;
# type MyOtherType;
# }
# }

