Rust functions made callable to C++. Just like for opaque types, these functions refer implicitly to something in scope in the super module, whether defined there or imported by some use statement. #[cxx::bridge]
mod ffi { extern "Rust" { type MyType; fn f() -> Box<MyType>; }
} struct MyType(i32); fn f() -> Box<MyType> { return Box::new(MyType(1));
} Extern Rust function signature may consist of types defined in the bridge, primitives, and any of these additional bindings .

42.body:
Any signature with a self parameter is interpreted as a Rust method and exposed to C++ as a non-static member function. # #[cxx::bridge]
# mod ffi { extern "Rust" { type MyType; fn f(&self) -> usize; }
# } The self parameter may be a shared reference &self, an exclusive reference &mut self, or a pinned reference self: Pin<&mut Self>. A by-value self is not currently supported. If the surrounding extern "Rust" block contains exactly one extern type, that type is implicitly the receiver for a &self or &mut self method. If the surrounding block contains more than one extern type, a receiver type must be provided explicitly for the self parameter, or you can consider splitting into multiple extern blocks. # #[cxx::bridge]
# mod ffi { extern "Rust" { type First; type Second; fn bar(self: &First); fn foo(self: &mut Second); }
# }

