Type defined in C++ that are made available to Rust, but only behind an indirection. # #[cxx::bridge]
# mod ffi { extern "C++" { # include!("path/to/header.h"); # type MyType; type MyOtherType; }
# } For example in the Tutorial we saw BlobstoreClient implemented as an opaque C++ type. The blobstore client was created in C++ and returned to Rust by way of a UniquePtr. Mutability: Unlike extern Rust types and shared types, an extern C++ type is not permitted to be passed by plain mutable reference &mut MyType across the FFI bridge. For mutation support, the bridge is required to use Pin<&mut MyType>. This is to safeguard against things like mem::swap-ing the contents of two mutable references, given that Rust doesn't have information about the size of the underlying object and couldn't invoke an appropriate C++ move constructor anyway. Thread safety: Be aware that CXX does not assume anything about the thread safety of your extern C++ types. In other words the MyType etc bindings which CXX produces for you in Rust do not come with Send and Sync impls. If you are sure that your C++ type satisfies the requirements of Send and/or Sync and need to leverage that fact from Rust, you must provide your own unsafe marker trait impls. # #[cxx::bridge]
# mod ffi {
# extern "C++" {
# include!("path/to/header.h");
#
# type MyType;
# }
# }
#
/// The C++ implementation of MyType is thread safe.
unsafe impl Send for ffi::MyType {}
unsafe impl Sync for ffi::MyType {} Take care in doing this because thread safety in C++ can be extremely tricky to assess if you are coming from a Rust background. For example the BlobstoreClient type in the tutorial is not thread safe despite doing only completely innocuous things in its implementation. Concurrent calls to the tag member function trigger a data race on the blobs map.

