This largely follows the same principles as extern "Rust" functions and methods. In particular, any signature with a self parameter is interpreted as a C++ non-static member function and exposed to Rust as a method; any signature with a #[Self = "‚Ä¶"] attribute is interpreted as a C++ static member function and exposed to Rust as an associated function. The programmer does not need to promise that the signatures they have typed in are accurate; that would be unreasonable. CXX performs static assertions that the signatures exactly correspond with what is declared in C++. Rather, the programmer is only on the hook for things that C++'s static information is not precise enough to capture, i.e. things that would only be represented at most by comments in the C++ code unintelligible to a static assertion: namely whether the C++ function is safe or unsafe to be called from Rust. Safety: the extern "C++" block is responsible for deciding whether to expose each signature inside as safe-to-call or unsafe-to-call. If an extern block contains at least one safe-to-call signature, it must be written as an unsafe extern block, which serves as an item level unsafe block to indicate that an unchecked safety claim is being made about the contents of the block. #[cxx::bridge]
mod ffi { unsafe extern "C++" { # include!("path/to/header.h"); # fn f(); // safe to call } extern "C++" { unsafe fn g(); // unsafe to call }
}

